import Home from '../pages/Home/index'
import Login from '../pages/Login/index'
import Test from '../pages/Test/index'
let routes=[
    {
        path:'/',
        element:<Test></Test>,
    },
    {
        path:'/Home',
        element:<Home></Home>,
    },
    {
        path:'/login',
        element:<Login></Login>,
    },
    {
        path:'*',
        element:<NotFound></NotFound>
    }
]

export default routes
